import { ThemeOptions } from '@material-ui/core';

const breakpoints: ThemeOptions['breakpoints'] = {
  values: {
    xs: 375,
    sm: 500,
    md: 768,
    lg: 1024,
    xl: 1250,
  },
};

export default breakpoints;
